#!/bin/sh

. ../bash_functions.sh

C=400
REQ=100000
MOD=100

if [ -z "$3" ]; then
  echo "Usage: $0 core ip port"
  exit 1
fi
CORE="$1"
HOST="$2"
PORT="$3"
if [ -n "$4" -a "$4" == "TEST" ]; then
  C=1
  REQ=1
fi

TASKSET="taskset -c ${CORE} "
ARGS=" -h ${HOST} -p ${PORT} -q "

pushd ..

function recreate() {
  $CLI -h ${HOST} -p ${PORT} DROP TABLE sessions >/dev/null
  $CLI -h ${HOST} -p ${PORT} CREATE TABLE sessions "(id INT, account_id INT, user_id INT, timestamp INT, session__data TEXT)" >/dev/null
}

recreate
echo -ne "small ONE PACKET: "
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,XXXXXXX)"

recreate
echo -ne "BIG ONE PACKET: "
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

recreate
echo -ne "small 2 PACKETS: "
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

recreate
echo -ne "BIG 2 PACKETS: "
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

recreate
echo -ne "small 3 PACKETS: "
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"


recreate
echo -ne "BIG 3 PACKETS: "
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

recreate
echo -ne "small 4  PACKETS:"
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

recreate
echo -ne "5K: "
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

popd
